import React from 'react';
import { Card, Row, Col, Container } from 'react-bootstrap';
import '../courses/courses.styles.css';

const CourseContent = (images) => (
    <Container>   
        {
            console.log(images)
        }
        <Row>
            <Col>
                <Card  key={images.id} style={{ width: '18rem' }} className="card">
                    <Card.Img variant="top" src={images.name}/>
                    <Card.Body>
                        <span className="title">{images.title}</span>
                    </Card.Body>
                </Card>   
            </Col>                     
        </Row>
    </Container>
)
export default CourseContent;
